import React, { useEffect, useState } from 'react'
import axios from 'axios';

function App() {
  const [posts,setPost] = useState([]);

  useEffect(()=>{
    const axiosPost = async () => {
      const response = await axios('https://jsonplaceholder.typicode.com/post')
      setPost(response.data);
    };
    axiosPost();
  },[])
  const usePost = posts.map((post)=>{
    return (
      <div>
        <p>{post.id}</p>
        <h2>{post.title}</h2>
      </div>
    )
  })
  return
}

export default App
